import React, { Component } from 'react';
import Price from './Price'


class Product extends React.Component {
    render() {
        return (
            <>
                <h1>
                    product {this.props.name} <br />
                    {this.props.price} <br />
                     product price <Price />
                </h1>

                {/* <h2></h2> */}


            </>
        );
    };

}

export default Product;
